import { useEffect, useState } from 'react';

export default function CRON(props) {
  const [cronState, setCronState] = useState([]);
  const shit = ["a", "b", "c"]

  useEffect(()=>{
    fetch("http://localhost:4000/api/monitor/cron").then(res => res.json())
    .then(cron => {
      setCronState(cron)
    })
    console.log(Array.from(shit).map(item=><div>shit</div>))
  },[])

  return (
    <div className={`card-wrapper ${props.className}`}>
      <p className="card-title">CRON</p>
      <table>
        <thead>
          <tr>
            <th>Keys</th>
            <th>Values</th>
          </tr>
        </thead>
        <tbody>
          {Object.keys(cronState).map((item, index)=>{
            <tr key={index}>
              <td>{item}</td>
              <td>{cronState[item]}</td>
            </tr>
          })}
          {Array.from([1,2,3]).map(item=>{
            <tr key={item}>
              <td>SHIT</td>
              <td>SHIT</td>
            </tr>
          })}
        </tbody>
      </table>
    </div>
  )
}
